import React, { useState } from 'react';
import Button from '@material-ui/core/Button';
import AddIcon from '@material-ui/icons/Add';

const CreateNote = () => {
    const [note,setNote] = useState({
        title : '',
        content : '',
    });
    const inputEvent = (event) => {
        setNote()();
    };
    return(
        <>
        <div className="main_note">
            <form>
                <input type="text" value={note.title} onChange={inputEvent} placeholder="Title" autoComplete="off"/>
    <textarea type="text" rows="" columns="" value={note.content} onChange={inputEvent} placeholder="Add Notes..."></textarea>
                <Button>
                    <AddIcon className="plus_sign" />
                </Button>

            </form>
        </div>
        </>
    );
};

export default CreateNote;
